import React from "react";
import bg from "./faq.png";

const Blogs = () => {
  return (
    <div>
      <div className="text-center">
        <p className="text-primary font-medium">Blogs</p>
        <p className="font-bold text-xl"> Get ready for healhy blogs </p>
      </div>
      <div className="flex">
        <div
          className=" flex flex-row justfy-center items-center  bg-center bg-cover w-64 h-80 bg-gradient-to-t from-gray-700 to-gray-0 rounded bg-opacity-0  "
          style={{
            backgroundImage: `url(${bg})`,
            // background: `linear-gradient(0deg, #000000 0%, #ffffff 100%)`,
          }}
        >
          <div className="align-middle bg-primary h-full w-full opacity-90 bg-gradient-to-t from-gray-900 "></div>
        </div>
      </div>
    </div>
  );
};

export default Blogs;
